void Display_Task (void const * argument){

	EventBits_t uxBits;

	/* Disable deep sleep */
	Mngm_DeepSleep_en (0);

	osDelay(1);

	// Create the event group
	Display_Event = xEventGroupCreateStatic( &Display_EventGroupBuffer );

	// Create low frequency timer
	Low_Timer = xTimerCreateStatic("Low_Timer", // Just a text name, not used by the kernel.
			LOW_TIMER_MS ,     					// The timer period in ticks.
			pdTRUE,         					// The timers will auto-reload themselves when they expire.
			"Low_Timer",     					// Assign each timer a unique id equal to its array index.
			Low_Timer_Callback,     			// Each timer calls the same callback when it expires.
			&Low_Timer_Buffer
	);

	/* INIT Display */
	screen_init();
	//uint8_t counter = 0;
	char heartrate_buffer[20] = {0};
	char temperature_buffer[20] = {0};
	char spo2_buffer[20] = {0};

	char bpm[3] = "bpm";
	char spo2[] = "SpO2";

	char sbpm[] = "78.52 bpm";
	char sspo2[] = "98%   SpO2";
	char stemp[] = "30.7";

	/* start application */
	xTimerStart( Low_Timer, 1500 );
	while (1){

		/* Enable deep sleep */
		Mngm_DeepSleep_en (1);

		uxBits = xEventGroupWaitBits(
				/* The event group being tested. */
				Display_Event,
				/* The bits within the event group to wait for. */
				EVT_DISP,
				/* BIT_0 & BIT_4 should be cleared before returning. */
				pdTRUE,
				/* Don't wait for both bits, either bit will do. */
				pdFALSE,
				/* Wait a maximum of 100ms for either bit to be set. */
				portMAX_DELAY );

		/* Disable deep sleep */
		Mngm_DeepSleep_en (0);

		if(IS_EVT(EVT_DISP)){
			/* periodic code here */

			// Draw the amazing ETH logo
			screen_drawETH(52, 200);

			// Draw the famous PBL logo
			screen_drawPBL(64,90);

			// Draw the heartrate
			//snprintf(heartrate_buffer, 20 ,"%2.2f", Sen_dt_b.HeartRate);
			//screen_drawString(70, 160, stringSmall, sizeof(heartrate_buffer), heartrate_buffer);
			//screen_drawSmallChar(150, 160, 259); // heart symbol
			//screen_drawString(142, 160, stringSmall, sizeof(bpm), bpm);

			// Draw static heartrate
			screen_drawString(70, 160, stringSmall, sizeof(sbpm), sbpm);

			// Draw SPo2
			//snprintf(spo2_buffer, 20, "%2i%%", Sen_dt_b.spo2);
			//screen_drawString(70, 140, stringSmall, sizeof(spo2_buffer), spo2_buffer);
			//screen_drawString(142, 140, stringSmall, sizeof(spo2), spo2);

			// Draw static SpO2
			screen_drawString(70, 140, stringSmall, sizeof(sspo2), sspo2);

			// Draw Temperature
			//snprintf(temperature_buffer, 20 ,"%2.2f", Sen_dt_b.temp_degC);
			//screen_drawString(70, 120, stringSmall, sizeof(temperature_buffer), temperature_buffer);
			//screen_drawSmallChar(142, 120, 167);	//°
			//screen_drawSmallChar(154, 120, 'C');

			// Draw static temperature
			screen_drawString(70, 120, stringSmall, sizeof(stemp), stemp);
			screen_drawSmallChar(142, 120, 167);	//°
			screen_drawSmallChar(154, 120, 'C');








			// Draw the connectivity symbol
			screen_drawBigNb4(30, 150);

			// Draw health alarm symbol
			screen_drawHealthAlarm(200, 124);

			// Write the internal screen map onto the display
			screen_update();

			// clear the written values on the internal screen map
			screen_clearString(70, 160, stringSmall, sizeof(heartrate_buffer), heartrate_buffer);
			screen_clearString(70, 140, stringSmall, sizeof(spo2_buffer), spo2_buffer);
			screen_clearString(70, 120, stringSmall, sizeof(temperature_buffer), temperature_buffer);
		}
		CHECK_STACK_OF();
	}
}

//== Display Functions ===========================================================

void screen_init(void){
	set_screen_map_zero();	// Clear the internal screen map
	screen_update();		// Clear physical screen by writing the screen map to it
	screen_on();			// Activate Screen, data will now be displayed
}

void screen_on(void){
	HAL_GPIO_WritePin(GPIOC, GPIO_PIN_5, GPIO_PIN_SET);
}

void screen_off(void){
	HAL_GPIO_WritePin(GPIOC, GPIO_PIN_5, GPIO_PIN_RESET);
}

void screen_cs_set(void){
	HAL_GPIO_WritePin(GPIOC, GPIO_PIN_4, GPIO_PIN_SET);
}

void screen_cs_reset(void){
	HAL_GPIO_WritePin(GPIOC, GPIO_PIN_4, GPIO_PIN_RESET);
}

void screen_setPixel(uint8_t pos_x, uint8_t pos_y){
		screen_map[pos_y - 1][(pos_x - 1 )/ 8] &= (~bit_lookup[pos_x % 8]); 	// Update screen_map with the pixel-value: specific bit is set to 0
}

void screen_resetPixel(uint8_t pos_x, uint8_t pos_y){
		screen_map[pos_y - 1][(pos_x - 1 )/ 8] |= bit_lookup[pos_x % 8]; 		// Update screen_map with the pixel-value: specific bit is set to 1
}

void screen_drawSmallChar(uint8_t pos_x, uint8_t pos_y, uint8_t c){
	for (uint8_t y = 0; y < 16; y++){
		for (uint8_t x = 0; x < 12; x++){
			if((smallfont[c][1-y/8 + x * 2] & inv_char[y % 8]) != 0){
				screen_setPixel(pos_y - y, pos_x + x );
			}
		}
	}
}

void screen_clearSmallChar(uint8_t pos_x, uint8_t pos_y, uint8_t c){
	for (uint8_t y = 0; y < 16; y++){
		for (uint8_t x = 0; x < 12; x++){
			if((smallfont[c][1-y/8 + x * 2] & inv_char[y % 8]) != 0){
				screen_resetPixel(pos_y - y, pos_x + x );
			}
		}
	}
}

void screen_drawBigChar(uint8_t pos_x, uint8_t pos_y, uint8_t c){
	for (uint8_t y = 0; y < 40; y++){
		for (uint8_t x = 0; x < 24; x++){
			if((bigfont[c][2 + y*3 + - x/8] & inv_char[x % 8]) != 0){
				screen_setPixel(  pos_y - y, pos_x + x);
			}
		}
	}
}

void screen_clearBigChar(uint8_t pos_x, uint8_t pos_y, uint8_t c){
	for (uint8_t y = 0; y < 40; y++){
		for (uint8_t x = 0; x < 24; x++){
			if((bigfont[c][2 + y*3 + - x/8] & inv_char[x % 8]) != 0){
				screen_resetPixel(  pos_y - y, pos_x + x);
			}
		}
	}
}

void screen_drawString(uint8_t pos_x, uint8_t pos_y, uint8_t size, uint8_t stringLenght, char* string){
	if(size){												// Draw big letters
		for(uint8_t i = 0; i < stringLenght; i++){
			 screen_drawBigChar(pos_x + i*24, pos_y, string[i]);	// step 24 pixels forward for every new char
		}
	}
	else{
		for(uint8_t i = 0; i < stringLenght; i++){
					 screen_drawSmallChar(pos_x + i*12, pos_y , string[i]);	// step 12 pixels forward for every new char
		}
	}
}

void screen_clearString(uint8_t pos_x, uint8_t pos_y, uint8_t size, uint8_t stringLenght, char* string){
	if(size){												// Draw big letters
		for(uint8_t i = 0; i < stringLenght; i++){
			 screen_clearBigChar(pos_x + i*24, pos_y, string[i]);	// step 24 pixels forward for every new char
		}
	}
	else{
		for(uint8_t i = 0; i < stringLenght; i++){
					 screen_clearSmallChar(pos_x + i*12, pos_y , string[i]);	// step 12 pixels forward for every new char
		}
	}
}


